  return (
    <div className="App">
      <NavBar />

      <Routes>
        <Route path='/' element={<Dashboard name='Maddy'/>}/>
        <Route path='/aboutme' element={<AboutMe name='Maddy'/>}/>
        <Route path='/aboutme' element={<AboutMe name='Maddy'/>}/>
